import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Scrollbar } from 'swiper/modules';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/scrollbar';
import Image1 from '../../assets/images/image1.png';
import Image2 from '../../assets/images/image2.png';
import Image3 from '../../assets/images/image3.png';

function Carousel_Progetto(){
    return (
        <div className="carousel">
            <Swiper
                className='mySwiper'
                slidesPerView="auto"
                spaceBetween={30}
                scrollbar= {{
                    el: ".swiper-scrollbar",
                    hide: false,
                }}
                breakpoints={{
                    660: {
                      spaceBetween: 45
                    },
                    1681: {
                      slidesPerView: 2,
                      spaceBetween: 45
                    },
                    1920: {
                      slidesPerView: 2.5,
                      spaceBetween: 45
                    }
                }}
                navigation= {{
                    nextEl: '.swiper-custom-button-next',
                    prevEl: '.swiper-custom-button-prev',
                }}
                modules={[Navigation, Scrollbar]}
            >
                <SwiperSlide>
                    <img src={Image1} />
                </SwiperSlide>
                <SwiperSlide>
                    <img src={Image2} />
                </SwiperSlide>
                <SwiperSlide>
                    <img src={Image3} />
                </SwiperSlide>
            </Swiper>
            <div className="swiper-custom-button-next">Next</div>
            <div className="swiper-custom-button-prev">Prev</div>
        </div>
    );
}

export default Carousel_Progetto;
